INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8410223904139', 'Barritas de Almendras. Chocolate con leche', '(E) BARRITAS DE FRUTOS SECOS CON CHOCOLATE CON LECHE. Ingredientes: almendra 30%, chocolate con leche 28% (azúcar manteca de cacao, leche entera en polvo, pasta de cacao, emulgente: lecitinas de soja y girasol, aroma natural de vainilla), avellana 14%, pipas de calabaza, miel, pasta de manzana (concentrado de zumo de manzana y concentrado de puré de manzana). Cacao min. 35% en el chocolate con leche.  (EN) NUT & SEED BARS WITH MILK CHOCOLATE. Ingredients: almonds 30 %, milk chocolate 28% (sugar, cocoa butter, whole milk powder,emulsifier: soy and sunflower lecithin, natural vanilla flavouring), hazelnuts 14% , pumpkin seeds, honey, apple paste (concentrated apple juice and concentrated apple purée). Cocoa min 35% in milk chocolate  (PT) BARRAS DE FRUTOS SECOS COM CHOCOLATE DE LEITE. Ingredientes: amêndoa 30%, chocolate de leite 28% (açúcar, manteiga de cacau, leite gordo em pó, emulsionante: lecitinas de soja e girassol, aroma natural de baunilha), avela 14%, sementes de abóbora, mel, puré de maça (concentrado de sumo de maça e concentrado de puré de maça). Cacau minimo de 35% em chocolate com leite.  (DE) RIEGEL MIT NÜSSEN UND KERNEN UND MILCHSCHOKOLADE. Zutaten: Mandeln 30%, Milchschokolade 28% (Zucker, Kakaobutter, Vollmilchpulver, Emulgator: Soja - und Sonnenblumenlecithin, natirliches Vanillearoma), Haselnüsse 14%, Kürbískerne Honig,Apfelcreme (Apfelsaftkonzentrat und Apfelmuskonzentrat). Minimum Kakao 35% in Milchschokolade.  (FR) BARRES AUX FRUITS SECS ET CHOCOLAT AU LAIT. Ingrédients: amande 30%, chocolat au lait 28% (sucre, beurre de cacao, lait entier en poudre, émulsifiant:lécithine de soja et de tournesol, arôme naturel de vanille), noisette 14%, graines de courge, miel, pâte aux pommes (concentré de jus de pomme et concentré de compote de pomme). Cacao minimum de 35% dans le chocolat au lait.  (IT) BARRETTE DI FRUTTI SECCHI CON CIOCCOLATO AL LATTE. Ingredienti: mandorle 30%, cioccolato al latte 28% (zucchero, burro di cacao, latte intero in polvere, emulsionante: lecitine di soia e girasole, aroma naturale di vaniglia), nocciole 14%, semi di zucca, miele, pasta di mela (Succo di mela concentrato e purea di mela concentrata). Cacao minimo 35% in cioccolato al latte', 'https://static.openfoodfacts.org/images/products/841/022/390/4139/front_es.9.400.jpg', '43.5', '8.8', '29', '28.9', '8.8', '16.2', '0.04', '0.015748031496063', '', '0');

